export default async function SignOutPage(req, res, ctx) {
    if (res.body || (res.code && res.code !== 200)) {
        return;
    }
    const response = await ctx.resolve('auth-signout', req, res);
    if (response.code !== 200) {
        return;
    }
    res.redirect(req.data.path('redirect_uri', ctx.config.path('auth.redirect', '/')));
}
;
